import React , {Component} from 'react';
import './App';

class App extends Component{
  render(){
    return(
      <div>
        <p>Hello React</p>
        <Header title="Hellooo!!"/>
      </div>
    )
  }
}

class Header extends Component{
  render(){
    return(
      <div>
      <Header>ReactJs{this.props.title}</Header>
      </div>
    )
  }
}
export default App;
